properties.desc:
Our resident Catholic [read: Bob] came up with a brilliant idea: throw a party that says, "Hey Lent...IN YOUR FACE!"

If the concept doesn't offend your conscience, we hope you will stop by this Saturday to let us offend your digestive tract with meat, booze, and any other shenanigans we can cook up, on or off the grill.

(BEE[RF]){2,}
